import ExpenseItem from "./ExpenseItem";
import './ExpenseItem.css'

function Expenses(props) {
    return (
        <div className="expenses">
            <h2>Let's get started!</h2>
            <ExpenseItem
                title={props.expenses[0].title}
                amount={props[0].amount}
                date={props[0].date}>
            </ExpenseItem>
            <ExpenseItem
                title={props[1].title}
                amount={props[1].amount}
                date={props[1].date}>
            </ExpenseItem>
            <ExpenseItem
                title={props[2].title}
                amount={props[2].amount}
                date={props[2].date}>
            </ExpenseItem>
            <ExpenseItem
                title={props[3].title}
                amount={props[3].amount}
                date={props[3].date}>
            </ExpenseItem>
            <p>I enjoy this journey of knowledge seeking</p>
        </div>
    );
}

export default Expenses;
